INSERT INTO `tblcourse` (`id`, `title`, `description`, `specializationId`, `length`, `price`) VALUES
(1, 'Introduction to Programming', 'This is an entry-level course designed to provide students with fundamental knowledge and skills in computer programming. This course serves as a foundational stepping stone for individuals interested in exploring the world of software development and coding. Participants will delve into the basic principles of programming, learning how to formulate logical solutions to problems and implement them using a programming language.', 10, 45, 100),
(2, 'Network and switching', 'This is a comprehensive course that provides participants with a deep understanding of networking fundamentals and the essential concepts related to network switching. This course is designed for individuals aspiring to build a strong foundation in networking technologies and gain practical skills for configuring and managing network switches.', 10, 45, 170),
(3, 'Human Resource Fundamentals', 'This is a foundational course designed to provide participants with a comprehensive understanding of the essential principles and practices within the field of Human Resources (HR). This course is ideal for individuals seeking to build a strong knowledge base in HR or those looking to embark on a career in human resource management.', 2, 35, 223),
(4, 'Interior Architecture Entrepreneurship and Professional Development', 'This is a specialized course tailored for individuals aspiring to excel in the dynamic and creative field of interior architecture. This comprehensive program is designed to equip participants with the skills, knowledge, and entrepreneurial mindset needed to thrive in the competitive landscape of interior architecture and design.', 18, 100, 230),
(5, 'Global Media Industries', 'This is a dynamic and comprehensive course that delves into the intricate and ever-evolving landscape of media on a global scale. This course is designed to provide students with a profound understanding of the key concepts, trends, challenges, and opportunities that characterize the contemporary global media environment. Participants will explore various aspects of media industries, including the impact of globalization, emerging technologies, and the role of media in shaping societies and cultures worldwide.', 6, 60, 110),
(6, 'Data Structures and Algorithms', 'Laceration of posterior tibial artery, left leg', 16, 56, 174),
